import React from 'react';

function Experience() {
  return (
    <section className="experience">
      <h2>Expériences Professionnelles</h2>
      <aside className="experience-intro">
        <div className="aside-left-box">
          <h3>Je maîtrise :</h3>
          <ul>
            <li>La communication active</li>
            <li>La résolution de problèmes</li>
            <li>Le travail en équipe</li>
          </ul>
        </div>
        <div className="aside-right">
          <hr />
          <p>
            Grâce à mes expériences dans le  Tourisme
            {' '}
            <br />
            {' '}
            et le Luxe, je maîtrise la résolution de problèmes.
          </p>
        </div>
      </aside>
    </section>
  );
}

export default Experience;
